    return (
      <div>
        <h2>À propos de moi</h2>
        <p> Je suis développeuse d'applications web pour CGI.</p>
        <p>Je suis actuellement en master humanités numériques parcours création et édition numérique.</p>
      </div>
    );
  };
    
  export default APropos;
